import React from 'react';
import TableTr from './TableTr';

const Table = (props) => {
    return (
        <table className="result">
            <thead>
                <tr>
                    <th>Year</th>
                    <th>Total Savings</th>
                    <th>Interest (Year)</th>
                    <th>Total Interest</th>
                    <th>Invested Capital</th>
                </tr>
            </thead>
            <tbody>
                {props.yearlyData.length <= 0 && <p>No Data Found...</p>}
                {<TableTr yearsNumber={props.yearsNumber} totalSaving={props.totalSaving} interestGained={props.interestGained} totalInterestGained={props.totalInterestGained} totalInvested={props.totalInvested} />}
            </tbody>
        </table>
    )
}
export default Table;
